import React from "react";

export default function ContactList({ name, number, id, onRemove }) {
  return (
    <li key={id}>
      <span>{name}: </span>
      <span>{number}</span>
      <button onClick={() => onRemove(id)}>Delete</button>
    </li>
  );
}
